160	984	2048	During the past 20 years, a lot of effort has been devoted for systematic tracking and follow-up of large patient cohorts as well as other population characterization projects. One typical example is the UK Biobank. Only recently such projects have managed to gather sufficient data to allow more complex genetic trait queries and associations leading to Polygenic Risk Scores (PRS). Even though in Greece such population cohorts are not available, there are smaller, disease-specific cohorts with complete genotypic and phenotypic data. The proposed work includes the querying of these completely anonymized cohorts (through proper collaborations) in order to derive meaningful PRSs characterizing a variety of popular traits such as weight management and athletic performance. Currently, the prisma project is running on HYPATIA. This request has to do with adding more storage space to handle several results. Although we recently requested another 2TB storage, we need to execute SNP imputation algorithms which store a lot of intermediate results and current space is not sufficient.	\N	hot	2	1
