55	During the past 20 years, a lot of effort has been devoted for systematic tracking and follow-up of large patient cohorts as well as other population characterization projects. One typical example is the UK Biobank. Only recently such projects have managed to gather sufficient data to allow more complex genetic trait queries and associations leading to Polygenic Risk Scores (PRS).\r\nEven though in Greece such population cohorts are not available, there are smaller, disease-specific cohorts with complete genotypic and phenotypic data. The proposed work includes the querying of these completely anonymized cohorts (through proper collaborations) in order to derive meaningful PRSs characterizing a variety of popular traits such as weight management and athletic performance.	1	56	1	484	0	600	5ace1dbc-f9eb-43b2-a371-4f9390554773	40	\N
