71	RNA-Seq has become the standard method for transcriptomic research with various applications in both research and the clinic. Recently (Moulos & Hatzis, 2015, Fanidis & Moulos, 2020, Dimopoulos et al., 2021) we developed PANDORA, an algorithm which combines several statistical tests for RNA-Seq data using p-value combinations and Machine Learning for alternative splicing. These algorithms were shown to improve accuracy by reducing the overall number of false hits while also presenting stability under different normalization frameworks and more accurate downstream analysis.\r\n\r\nIn this project, we intend to test the expansion of PANDORA and its accuracy when using Machine Learning methods instead of p-value combinations. To this end we need to simulate large volumes of RNA-Seq data and perform intensive and repetitive computations including alignments to the reference genome and ML training.	1	28	1	242	0	694	a4b9f563-5efb-4742-bfd8-fce85f38c9ea	40	\N
