232	772	The goal of this project is the discovery of novel enzymes from metagenomic sequences. An automated pipeline/workflow has been created in the Python programming language based on the already existing platform of ANASTASIA (Automated Nucleotide Aminoacid Sequences Translational plAtform for Systemic Interpretation and Analysis). The automated pipeline incorporates multiple tools (FastQC, BBTools, Cutadapt, Megahit, SPAdes, FragGeneScan, CD-HIT, HMMER, BLASTp, Phobius) and databases (Pfam, part of or the whole nr database, UniprotKB-SwissProt, a profile database of specific pHMMs) for processing FASTQ/FASTA, paired-end or single-end files from different types of NGS platforms. The input files originate from extreme environmental niches (Russia, Iceland, China, U.S and more) or other online databases which include metagenomes (e.g. SRA archive of NCBI, JGI IMG/M, MG-RAST, MGnify). The main set backs of the workflow currently is the RAM needed to perform the alignment of the reads, the CPUs needed to perform a search of the whole nr database in reasonable time and the space needed for the SRA files, the FASTQ/FASTA input files and the files produced during the analysis (e.g. Megahit demands its input files to be uncompressed). The pipeline will also be used for the analysis of certain genomes.	developing	Metagenomic analysis	f	1000	64	16	\N
