302	A compositional perspective in prostate cancer	1.0	The concept that the evolution of the phenotype depends much more on changes in regulatory sequences than on changes in protein-coding genes was first proposed a long time ago (Zuckerkandl and Pauling 1965; Britten and David- son 1971; King and Wilson 1975) and is now well established (see Kasowski et al. 2010; and Felsenfeld and Groudine 2003; Carroll 2008 for reviews), with changes in the phenotype being associated more to changes in expression activity than on changes in protein-coding genes, and that cis-regulatory sequences and chromatin structure are two major factors influencing expression activity. On this aspect, vertebrate genomes have been shown to be mosaics of megabase-size DNA segments with a fairly homogeneous base composition, called isochores. The latter are divided into five families with different guanine-cytosine (GC) levels, with distinct functional (e.g., replication timing, expression activity, methylation, and gene ontology) and structural (e.g., chromatin structure/architecture and gene density) properties1. In this direction, there is increasing evidence on their implication during biological processes e.g., ageing, preimplantation process  but also cancer.\r\nThis work will exploit presence of patterns in the mouse isochores expression activity using RNA seq data from a cancer study using the tool IsoXpressor. In parallel novel RNA seq alignment tools will be incorporated into the IsoXpressor to assess accuracy and improvement in processing speed. To the outcomes will be additionally incorporated findings from the differential expression of the genes, using additional tools, in base of their isochoric location and their Gene Ontology patterns. This will allow to set up a novel version of IsoXpressor capable to be applied in any biological process from a genomic level up to that of genes.\r\n		1	4	1	16	0	787	0	11e0f263-7b88-4536-87f2-135abfc9fd34	40	\N
