180	96	deligianp@elixir-europe.org	Dear Stavros,\r\n\r\nThe error message you are receiving indicates that the SSH key you provide when attempting to login is wrong. Make sure that you are trying to connect with the proper user (by default, the VM is made for user `ubuntu`) and that you are providing the proper identity file, when calling the `ssh` command.\r\n\r\nIf the problem persists, then this means that you've been locked out of the VM. This could happen if you accidentally misconfigured the SSH server. For instance, one thing that has happened in the past for multiple users is that they moved everything from their home folder to an external provisioned volume. This had the effect of misplacing the .ssh folder. In each VM, the SSH server looks for the authorized keys of user `ubuntu`, at `/home/ubuntu/.ssh`. Thus if the server can't find the .ssh directory in `ubuntu` user's home, it will assume that there are no authorized keys for this user and will prompt the error you provided when attempting to connect.\r\n\r\nHYPATIA does not have a way to directly act on a VM's provisioned to a user. As a result, you can follow one of the following solutions:\r\n\r\n- If you had created a separate user for the VM and for which had enabled password authentication, you may use the "Console" interface, within your project's "Access" page.\r\n- If you don't have any way of currently accessing the VM, you will have to destroy and reallocate the resource, from your project's "Access" page. Any files stored on the VM's disk will be lost, while any files stored on external volumes will remain intact.\r\n\r\nThank you for using HYPATIA,\r\n\r\nOn behalf of HYPATIA support team,\r\nPanagiotis	1	2024-08-06 08:59:41
