185	98	deligianp@elixir-europe.org	Dear Ben,\r\n\r\nProvisioned resources cannot be extended while the VM is active; in order to request the extension of the provisioned resources the VM has to be deleted first. This means that if you need more computational power, you will have to delete the existing VM and modify the project with a request for more resources, then, once approved, create the new VM.\r\n\r\nDeletion of a VM also causes the deletion of any valuable data within that VM. To deal with this, a Storage volume may be used to act as a persistent block storage that can be mounted to different VMs based on the user's needs. In your case, we can see that the VM corresponding to project `bcg-vm-1`, has an attached storage that corresponds to the project `bcg`.\r\n\r\nRegardless of the above, the new request needs to be approved by the platform moderators who can ensure the availability of the new resources.\r\n\r\nTo sum up:\r\n\r\n- We will renew your project `bcg-vm1` for a couple of days, which will allow you to request a further extension if necessary.\r\n- If you need a VM with greater resources for the same project, you will need to delete the existing VM and state in your request the new resources that are needed. The new request will need to be approved by the platform moderators, after which you will be able to provision the new resources. Bear in mind that you 'll have to perform any data transfer necessary, between the VMs and the attached storage volume.\r\n\r\nPlease, let us know if you need any more help,\r\n\r\nOn behalf of HYPATIA support team,\r\nPanagiotis Deligiannis\r\n	1	2024-09-17 09:05:20
